syntax = "proto3";

option java_multiple_files = true;
option java_package = "io.grpc.examples.teerpc";
option java_outer_classname = "TeeUtilRpcProto";
option objc_class_prefix = "HLW";

package tee_util_rpc;

// Cypher data
message CypherData {
    bytes key = 1;
    bytes public_key = 2;
    bytes data = 3;
}
